public class InnerTemplateDefaultInteractiveLayoutConfigurationFactory(Action<Humidifier.QuickSight.TemplateTypes.DefaultInteractiveLayoutConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.TemplateTypes.DefaultInteractiveLayoutConfiguration>
{

    internal InnerTemplateDefaultFreeFormLayoutConfigurationFactory FreeFormFactory { get; set; }

    internal InnerTemplateDefaultGridLayoutConfigurationFactory GridFactory { get; set; }

    protected override Humidifier.QuickSight.TemplateTypes.DefaultInteractiveLayoutConfiguration Create()
    {
        var defaultInteractiveLayoutConfigurationResult = CreateDefaultInteractiveLayoutConfiguration();
        factoryAction?.Invoke(defaultInteractiveLayoutConfigurationResult);

        return defaultInteractiveLayoutConfigurationResult;
    }

    private Humidifier.QuickSight.TemplateTypes.DefaultInteractiveLayoutConfiguration CreateDefaultInteractiveLayoutConfiguration()
    {
        var defaultInteractiveLayoutConfigurationResult = new Humidifier.QuickSight.TemplateTypes.DefaultInteractiveLayoutConfiguration();

        return defaultInteractiveLayoutConfigurationResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.TemplateTypes.DefaultInteractiveLayoutConfiguration result)
    {
        base.CreateChildren(result);

        result.FreeForm ??= FreeFormFactory?.Build();
        result.Grid ??= GridFactory?.Build();
    }

} // End Of Class

